[include shell_command.cfg]
#Troodon V2 + SB2009 + Beacon probe
#To use this config, the firmware should be compiled for the STM32F407 with a "32KiB bootloader"  BigTreeTech Octopus X7



########################################
# Included Files
########################################

[include mainsail.cfg]
[include macros.cfg]
[include timelapse.cfg]
[include beacon.cfg]
[include stealthburner_leds.cfg]
[include home_if_needed.cfg]
[include heatsoak.cfg]
#[include set_pa.cfg]
[include speed_test.cfg]
[include config_backup.cfg]
#[include pis.cfg] Not needed with onboard adxl

[exclude_object]

[gcode_arcs]
resolution: 0.5
#   An arc will be split into segments. Each segment's length will
#   equal the resolution in mm set above. Lower values will produce a
#   finer arc, but also more work for your machine. Arcs smaller than
#   the configured value will become straight lines. The default is
#   1mm.

[idle_timeout]
timeout: 1800
gcode:
    {% if printer.pause_resume.is_paused %}
    M118 Idle Timeout reached
    M117 Disable hotend_fan
    SET_HEATER_TEMPERATURE HEATER=extruder TARGET=0
    STATUS_READY
    {% else %}
    SLEEP
    {% endif %}

########################################
# Printer & MCU Settings
########################################

[printer]
kinematics: corexy
max_velocity: 400  
max_accel: 15000             
max_z_velocity: 50          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
square_corner_velocity: 5.0

[mcu]
##  Obtain definition by "ls -l /dev/serial/by-id/" then unplug to verify
##--------------------------------------------------------------------
serial: /dev/serial/by-id/usb-Klipper_stm32f407xx_3A0036001147313335343634-if00
restart_method: command

[mcu EBBCan]
canbus_uuid: b01fa7ab9219
##--------------------------------------------------------------------

########################################
# Input Shaper/Retraction Settings
########################################

[input_shaper]
shaper_freq_x: 63
shaper_type_x: zv
shaper_freq_y: 45.2
shaper_type_y: zv

[adxl345]
cs_pin: EBBCan: PB12
spi_software_sclk_pin: EBBCan: PB10
spi_software_mosi_pin: EBBCan: PB11
spi_software_miso_pin: EBBCan: PB2
axes_map: z,-y,x

[resonance_tester]
probe_points: 175, 175, 20
accel_per_hz: 75
accel_chip: adxl345

[firmware_retraction] # make sure to enable this in slicer. cura printer settings addon is required to hit the check box. every other slicer should have it in settings tab. this allows live adjustments or ability to fix a mistake without canceling. 
retract_length: 0.8
retract_speed: 35
unretract_extra_length: 0
unretract_speed: 35




########################################
# X Stepper Motor & Driver Settings
########################################




[stepper_x]   #MOTOR_0
step_pin: PA3
dir_pin: PA4
enable_pin: !PA1
rotation_distance: 40
microsteps: 32
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: EBBCan: PB6
position_min: 0
position_endstop: 351
position_max: 351
homing_speed: 75   #Max 100
homing_retract_dist: 5
homing_positive_dir: true


[tmc2209 stepper_x]
uart_pin: PA2
interpolate: false
run_current: 0.8
hold_current: 0.5
sense_resistor: 0.110
stealthchop_threshold: 0

########################################
# Y Stepper Motor & Driver Settings
########################################

[stepper_y]  #MOTOR_1
step_pin: PC2
dir_pin: PC3
enable_pin: !PC1
rotation_distance: 40
microsteps: 32
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: PC15
position_min: 0
position_endstop: 353
position_max: 353
homing_speed: 75  #Max 100
homing_retract_dist: 5
homing_positive_dir: true



[tmc2209 stepper_y]
uart_pin: PC0
interpolate: false
run_current: 0.8
hold_current: 0.5
sense_resistor: 0.110
stealthchop_threshold: 0
 
########################################
# Z Stepper Motor & Driver Settings
########################################


[stepper_z] #MOTOR_4 Front Left
step_pin: PB10
dir_pin: PB11
enable_pin: !PE15
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32
endstop_pin: probe:z_virtual_endstop # use beacon as virtual endstop
homing_retract_dist: 0 # beacon needs this to be set to 0
#endstop_pin: PC13 # Zendstop back 
#homing_retract_dist: 3 # use with back z endstop
##  Z-position of nozzle (in mm) to z-endstop trigger point relative to print surface (Z0)
##  (+) value = endstop above Z0, (-) value = endstop below
##  Increasing position_endstop brings nozzle closer to the bed
##  After you run Z_ENDSTOP_CALIBRATE, position_endstop will be stored at the very end of your config
#position_endstop: 0
position_max: 310
position_min: -5
homing_speed: 8
second_homing_speed: 3



[tmc2209 stepper_z]
uart_pin: PE14
interpolate: false
run_current: 0.8
hold_current: 0.5
sense_resistor: 0.110
stealthchop_threshold: 0


[stepper_z1] #MOTOR_3 rear Left
step_pin: PE11
dir_pin: !PE12
enable_pin: !PE10
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32


[tmc2209 stepper_z1]
uart_pin: PE9
interpolate: false
run_current: 0.8
hold_current: 0.5
sense_resistor: 0.110
stealthchop_threshold: 0


[stepper_z2]  #MOTOR_6 Rear Right
step_pin: PE7
dir_pin: PE8
enable_pin: !PG1
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32


[tmc2209 stepper_z2]
uart_pin: PG0
interpolate: false
run_current: 0.8
hold_current: 0.5
sense_resistor: 0.110
stealthchop_threshold: 0

[stepper_z3] #MOTOR_5 Front Right
step_pin: PF13
dir_pin: !PF14
enable_pin: !PF12
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32


[tmc2209 stepper_z3]
uart_pin: PF11
interpolate: false
run_current: 0.8
hold_current: 0.5
sense_resistor: 0.110
stealthchop_threshold: 0


########################################
# Extruder & Driver Settings
########################################

[extruder]
step_pin: EBBCan: PD0
dir_pin: EBBCan: PD1
enable_pin: !EBBCan: PD2
rotation_distance: 22.6789511   
##  Use 50:10 for Stealthburner/Clockwork 2
##  Use 50:17 for Afterburner/Clockwork (BMG Gear Ratio)
##  Use 80:20 for M4, M3.1
gear_ratio: 50:10               #BMG Gear Ratio
microsteps: 32
full_steps_per_rotation: 200    #200 for 1.8 degree, 400 for 0.9 degree
nozzle_diameter: 0.400
filament_diameter: 1.75
heater_pin:  EBBCan: PB13
sensor_type: EPCOS 100K B57560G104F
sensor_pin:  EBBCan: PA3
min_temp: 10
max_temp: 270
max_power: 1.0
min_extrude_temp: 170
max_extrude_only_distance: 150
#control = pid
#pid_kp = 26.213
#pid_ki = 1.304
#pid_kd = 131.721
pressure_advance: 0.06 #PLA
pressure_advance_smooth_time: 0.040


[tmc2209 extruder]
uart_pin: EBBCan:PA15
interpolate: false
run_current: 0.650
sense_resistor: 0.110
stealthchop_threshold: 0


#########################################
# Bed Settings
########################################

[heater_bed]
heater_pin: PD12
sensor_type: Generic 3950
sensor_pin: PA0
max_power: 0.6
min_temp: 0
max_temp: 120
#control: pid
#pid_kp: 58.437
#pid_ki: 2.347
#pid_kd: 363.769


########################################
# Fans & Temp Settings
########################################

#  Parts Fan 
[fan]
pin: EBBCan:PA1
kick_start_time: 0.5
##  Depending on your fan, you may need to increase this value
##  if your fan will not start. Can change cycle_time (increase)
##  if your fan is not able to slow down effectively
off_below: 0.10

##  Hotend Fan - FAN1
[heater_fan hotend_fan]
pin: EBBCan:PA0
max_power: 1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0
##  If you are experiencing back flow, you can reduce fan_speed
fan_speed: 1

##  Steppers/control board - FAN2
[controller_fan controller_fan]
pin: PC6
kick_start_time: 0.5
heater: extruder,heater_bed
stepper: stepper_x,stepper_y,stepper_z,extruder
hardware_pwm:false
max_power: 1.0
shutdown_speed: 0.0
idle_timeout: 45
idle_speed: .4
kick_start_time: 0.100


[fan_generic chamber]
pin:PE5
#max_power:
#shutdown_speed:
#cycle_time:
hardware_pwm:True
#kick_start_time:
off_below:.6


